function ({ csvData }, { parsedData }) {
  const rows = csvData.split('\n');
  const headers = rows[0].split(',');

  for (let i = 1; i < rows.length; i++) {
    const values = rows[i].split(',');
    const row = {};

    for (let j = 0; j < headers.length; j++) {
      row[headers[j]] = values[j];
    }

    parsedData.next(row);
  }
}
